        body {

        }

            max-width: 1200px;

            padding: 0 20px;

            color: #333;
            text-align: center;
        }

            color: #0000FF;
            text-decoration: none;
            border: none;
            border-radius: 5px;
            cursor: pointer;
            transition: background-color 0.3s ease;
        }
        .btn:hover {
            background-color: #44FFFF;
        }
        a {
            color: #000;
            text-decoration: none;
            position: relative;
            display: inline-block;
        }
        a::before {
            content: '';
            position: absolute;
            width: 100%;
            height: 2px;
            background-color: #000;
            bottom: -5px;
            transform: scaleX(0);
            transition: transform 0.3s ease;
        }
        a:hover::before {
            transform: scaleX(1);
        }
        footer {
            background-color: #333;
            color: #00FFFF;
            text-align: center;
            padding: 20px 0;
        }
        nav {

            padding: 10px;
